def predict(triples: list[Triple]) -> str:
    sentence = ""
    for i, triple in enumerate(triples):
        if i == 0:
            sentence += f"{triple.subject} "

        if triple.predicate == "cityServed":
            sentence += f"serves the city of {triple.object}, "
        elif triple.predicate == "country":
            sentence += f"which is located in {triple.object}, "
        elif triple.predicate == "capital":
            sentence += f"whose capital is {triple.object}, "
        elif triple.predicate == "elevationAboveTheSeaLevel":
            sentence += f"with an elevation of {triple.object} meters above sea level, "
        elif triple.predicate == "location":
            sentence += f"located in {triple.object}, "
        elif triple.predicate == "operatingOrganisation":
            sentence += f"and is operated by {triple.object}, "
        elif triple.predicate == "runwayLength":
            sentence += f"with a runway length of {triple.object} meters, "
        elif triple.predicate == "runwayName":
            sentence += f"and has runway {triple.object}, "
        elif triple.predicate == "isPartOf":
            sentence += f"which is part of {triple.object}, "
        elif triple.predicate == "1stRunwayLengthFeet":
            sentence += f"with a first runway length of {triple.object} feet, "
        elif triple.predicate == "1stRunwaySurfaceType":
            sentence += f"and a first runway surface of {triple.object}, "
        elif triple.predicate == "3rdRunwayLengthFeet":
            sentence += f"with a third runway length of {triple.object} feet, "
        elif triple.predicate == "icaoLocationIdentifier":
            sentence += f"and has ICAO identifier {triple.object}, "
        elif triple.predicate == "locationIdentifier":
            sentence += f"with location identifier {triple.object}, "
        elif triple.predicate == "elevationAboveTheSeaLevelInFeet":
            sentence += f"with an elevation of {triple.object} feet above sea level, "
        elif triple.predicate == "iataLocationIdentifier":
            sentence += f"and has IATA identifier {triple.object}, "
        elif triple.predicate == "nativeName":
            sentence += f"also known as {triple.object}, "
        elif triple.predicate == "leaderParty":
            sentence += f"led by {triple.object}, "
        elif triple.predicate == "language":
            sentence += f"where {triple.object} is spoken, "
        elif triple.predicate == "owner":
            sentence += f"owned by {triple.object}, "
        elif triple.predicate == "1stRunwayLengthMetre":
            sentence += f"with a first runway length of {triple.object} meters, "
        elif triple.predicate == "4thRunwaySurfaceType":
            sentence += f"and a fourth runway surface of {triple.object}, "
        elif triple.predicate == "largestCity":
            sentence += f"near the city of {triple.object}, "
        elif triple.predicate == "4thRunwayLengthFeet":
            sentence += f"with a fourth runway length of {triple.object} feet, "
        elif triple.predicate == "elevationAboveTheSeaLevelInMetres":
            sentence += f"with an elevation of {triple.object} meters above sea level, "
        elif triple.predicate == "administrativeArrondissement":
            sentence += f"located in the {triple.object}, "
        elif triple.predicate == "officialLanguage":
            sentence += f"with the official language {triple.object}, "
        elif triple.predicate == "regionServed":
            sentence += f"serving the region of {triple.object}, "
        else:
            sentence += f"and {triple.predicate} is {triple.object}, "

    if sentence.endswith(", "):
        sentence = sentence[:-2]
    return sentence + "."

